export default class SpeakerEvent {
    static get types(): {
        startedSpeaking: string;
        stoppedSpeaking: string;
        joined: string;
        left: string;
    };
    constructor(options?: {});
    topic: string;
    _type: any;
    _user: any;
    _timestamp: string;
    set type(arg: any);
    get type(): any;
    set user(arg: any);
    get user(): any;
    set timestamp(arg: string);
    get timestamp(): string;
    toJSON(): {
        topic: string;
        type: any;
        user: any;
        timestamp: string;
    };
}
